Description: 

Featuring Julia Ann &amp; Logan Pierce! When she gets caught in a compromising position with her professor, Sandi escapes with her boyfriend to her artistic free-spirit mother, Moon-Rose. Sandi's father took off with a beautiful hippy girl. Her boyfriend Clayton wouldn't do the same thing, would he? And especially not with her Mom! Starring the scintillating Karla Kush as Sandi, the always beautiful and luscious Julia Ann as Moon-Rose, and young hot Ariana Grand as the hippy girl with Logan Pierce, Erik Everhard, Daniel Hunter and a sweet acting cameo by Abigail Mac.

